CREATE PROCEDURE [dbo].[dsi_sp_BuildDriverTables_EHARTINFML]
    @SystemID char(12)
AS
SET NOCOUNT ON;
/**********************************************************************************
Client Name: Inspire Communities

Created By: Marco Lagrosa
Business Analyst: Lea King
Create Date: 11/5/2021
Service Request Number: TekP-2021-04-02-0005

Purpose: Hartford Accident and Critical Illness Export

Revision History
----------------
Update By           Date           Request Num        Desc
XXXX                XX/XX/2020     SR-2020-000XXXXX   XXXXX

SELECT * FROM dbo.U_dsi_Configuration WHERE FormatCode = 'EHARTINFML';
SELECT * FROM dbo.U_dsi_SqlClauses WHERE FormatCode = 'EHARTINFML';
SELECT * FROM dbo.U_dsi_Parameters WHERE FormatCode = 'EHARTINFML';
SELECT ExpFormatCode, ExpExportCode, ExpStartPerControl, ExpEndPerControl,* FROM dbo.AscExp WHERE expFormatCode = 'EHARTINFML';
SELECT * FROM dbo.U_dsi_InterfaceActivityLog WHERE FormatCode = 'EHARTINFML' ORDER BY RunID DESC;

Execute Export
--------------
EXEC dbo.dsi_sp_TestSwitchbox_v2 'EHARTINFML', 'ONDEMAND';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'EHARTINFML', 'OEPASSIVE';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'EHARTINFML', 'OEACTIVE';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'EHARTINFML', 'TEST';

EXEC dbo.dsi_BDM_sp_ErrorCheck 'EHARTINFML';

EXEC dbo._dsi_usp_ExportRipOut_v7_4 @FormatCode = 'EHARTINFML', @AllObjects = 'Y', @IsWeb = 'Y'
**********************************************************************************/
BEGIN

    --==========================================
    -- Declare variables
    --==========================================
    DECLARE  @FormatCode        VARCHAR(10)
            ,@ExportCode        VARCHAR(10)
            ,@StartDate         DATETIME
            ,@EndDate           DATETIME
            ,@StartPerControl   VARCHAR(9)
            ,@EndPerControl     VARCHAR(9)
            ,@Past12PerControl VARCHAR(9)
            ,@CurrentDate        DATETIME
            ;

    -- Set FormatCode
    SELECT @FormatCode = 'EHARTINFML';

    -- Declare dates from Parameter file
    SELECT
         @StartPerControl = StartPerControl
        ,@EndPerControl   = EndPerControl
        ,@StartDate       = LEFT(StartPerControl,8)
        ,@EndDate         = DATEADD(S,-1,DATEADD(D,1,LEFT(EndPerControl,8)))
        ,@ExportCode      = ExportCode
    FROM dbo.U_dsi_Parameters WITH (NOLOCK)
    WHERE FormatCode = @FormatCode;

    SELECT @Past12PerControl =  FORMAT(DATEADD(YEAR, -1, CAST(LEFT(@EndPerControl, 8) AS DATE)), 'yyyyMMdd') + '9';

    --==========================================
    -- Clean EE List 
    -- Caution: Careful of cleaning EE List if including paycheck data
    --==========================================

    -- Cleans EE List of terms where EE active in another company (transfer), or active in more than one company
    DELETE FROM dbo.U_EHARTINFML_EEList
    WHERE xCoID <> dbo.dsi_BDM_fn_GetCurrentCOID(xEEID)
    AND xEEID IN (SELECT xEEID FROM dbo.U_EHARTINFML_EEList GROUP BY xEEID HAVING COUNT(1) > 1);


    DELETE FROM dbo.U_EHARTINFML_EEList WHERE xEEID IN (
        SELECT DISTINCT Eeceeid FROM dbo.empcomp WITH (NOLOCK) WHERE eecEEType IN('TES')
    );


    --==========================================
    -- Create Deduction List
    --==========================================
    DECLARE @DedList VARCHAR(MAX)
    SET @DedList = 'HARAC,CI10E,CI10S,CI10C,CI10F,CI20E,CI20S,CI20C,CI20F';

    IF OBJECT_ID('U_EHARTINFML_DedList','U') IS NOT NULL
        DROP TABLE dbo.U_EHARTINFML_DedList;
    SELECT DISTINCT
         DedCode = DedDedCode
        ,DedType = DedDedType
    INTO dbo.U_EHARTINFML_DedList
    FROM dbo.fn_ListToTable(@DedList)
    JOIN dbo.DedCode WITH (NOLOCK)
        ON DedDedCode = Item;


    --==========================================
    -- BDM Section
    --==========================================
    DELETE FROM dbo.U_dsi_BDM_Configuration WHERE FormatCode = @FormatCode;

    -- Required parameters
    INSERT INTO dbo.U_dsi_BDM_Configuration VALUES(@FormatCode,'DedCodes',@DedList);
    INSERT INTO dbo.U_dsi_BDM_Configuration VALUES(@FormatCode,'StartDateTime',@StartDate);
    INSERT INTO dbo.U_dsi_BDM_Configuration VALUES(@FormatCode,'EndDateTime',@EndDate);
    INSERT INTO dbo.U_dsi_BDM_Configuration VALUES(@FormatCode,'TermSelectionOption','AuditDate');

    -- Non-Required parameters
    INSERT INTO dbo.U_dsi_BDM_Configuration VALUES (@FormatCode,'BuildConsolidatedTable','Standard');

    -- Required OE parameters
    IF @ExportCode LIKE '%PASSIVE'
    BEGIN
        INSERT INTO dbo.U_dsi_BDM_Configuration VALUES (@FormatCode,'OEType','PASSIVE');
    END;

    IF @ExportCode LIKE '%ACTIVE'
    BEGIN
        INSERT INTO dbo.U_dsi_BDM_Configuration VALUES (@FormatCode,'OEType','ACTIVE');
    END;


    -- Run BDM Module
    EXEC dbo.dsi_BDM_sp_PopulateDeductionsTable @FormatCode;

        EXEC dbo.dsi_bdm_sp_CalculateBenefitAmounts @FormatCode;

    --==========================================
    -- Build Working Tables
    --==========================================
    --=========================================
    -- Update BdmChangeReason For Dependents
    --=========================================
    UPDATE D
        SET D.BdmChangeReason = E.BdmChangeReason
    FROM dbo.U_dsi_bdm_EHARTINFML D
    JOIN dbo.U_dsi_bdm_EHARTINFML E
        ON E.BdmEEID = D.BdmEEID
        AND E.BdmCOID = D.BdmCOID
        AND E.BdmDedCode = D.BdmDedCode
    WHERE D.BdmRecType = 'DEP' AND E.BdmRecType = 'EMP';

    --=====================================================
    -- Update BdmUSGField2 with EmpDedTVID for Employees
    --=====================================================
    UPDATE dbo.U_dsi_bdm_EHARTINFML
        SET BdmUSGField2 = EedEmpDedTVID,
         BdmUSGField1 = CONVERT(VARCHAR(20),DedEEBenAmt)
    FROM dbo.U_dsi_bdm_EHARTINFML
    JOIN dbo.U_dsi_BDM_EmpDeductions WITH (NOLOCK)
        ON EedEEID = BdmEEID
        AND EedCOID = BdmCOID
        AND EedDedCode = BdmDedCode
    WHERE BdmRecType = 'EMP' AND EedFormatCode = @FormatCode AND EedValidForExport = 'Y';

    --=======================================================
    -- Update BdmUSGField2 with DepBPlanTVID for Dependents
    --=======================================================
    UPDATE dbo.U_dsi_bdm_EHARTINFML
        SET BdmUSGField2 = DbnDepBPlanTVID
    FROM dbo.U_dsi_bdm_EHARTINFML
    JOIN dbo.U_dsi_BDM_DepDeductions WITH (NOLOCK)
        ON DbnEEID = BdmEEID
        AND DbnCOID = BdmCOID
        AND DbnDedCode = BdmDedCode
    WHERE BdmRecType = 'DEP' AND DbnFormatCode = @FormatCode AND DbnValidForExport = 'Y';

    --======================================================
    -- Update BdmUSGField1 with Benefit Amount (EedBenAmt)
    --======================================================
    /*
    UPDATE dbo.U_dsi_bdm_EHARTINFML
        SET BdmUSGField1 = CONVERT(VARCHAR(20),EedBenAmt)
    FROM dbo.U_dsi_bdm_EHARTINFML
    JOIN dbo.EmpDedFull WITH (NOLOCK)
        ON EedEmpDedTVID = BdmUSGField2;
   */

    -----------------------------
    -- Working Table - PEarHist
    -----------------------------
    IF OBJECT_ID('U_EHARTINFML_PEarHist','U') IS NOT NULL
        DROP TABLE dbo.U_EHARTINFML_PEarHist;
    SELECT DISTINCT
         PehEEID
        ,PehCurHrsYTD           = SUM(CASE WHEN LEFT(PehPerControl,4) = LEFT(@EndPerControl,4) AND PehPerControl <= @EndPerControl THEN PehCurHrs ELSE 0.00 END)
        ,PehLast12MoHours = SUM(CASE WHEN PehEarnCode not in ('ANNU', 'HOL', 'PTO' , 'SIC' ) AND PehPerControl Between @Past12PerControl AND @EndPerControl  THEN PehCurHrs ELSE 0.00 END)
    INTO dbo.U_EHARTINFML_PEarHist
    FROM dbo.PayReg WITH (NOLOCK)
    JOIN dbo.PEarHist WITH (NOLOCK)
        ON PehGenNumber = PrgGenNumber
    GROUP BY PehEEID
    HAVING SUM(PehCurAmt) <> 0.00;


    SELECT @CurrentDate = GETDATE();


    IF OBJECT_ID('U_EHARTINFML_PTaxHist') IS NOT NULL

        DROP TABLE dbo.U_EHARTINFML_PTaxHist;

    SELECT DISTINCT
         PthEEID
        ,PthGrossWagesYTD    = SUM(PthCurTaxableWages)       
    INTO dbo.U_EHARTINFML_PTaxHist
    FROM dbo.PTaxHist WITH (NOLOCK)
    WHERE LEFT(PthPerControl,4) = CAST( LEFT(@EndPerControl,4) as Integer) - 1
    AND PthPerControl <= @EndPerControl
    AND PthTaxCode = 'USFIT'
    GROUP BY PthEEID
    HAVING SUM(PthCurGrossWages) <> 0.00;


    IF OBJECT_ID('U_EHARTINFML_JobHist','U') IS NOT NULL
        DROP TABLE dbo.U_EHARTINFML_JobHist;
    Select max(EjhFLSACategory) as EjhFLSACategory,ejheeid,max(ejhdatetimecreated) as ejhdatetimecreated 
        INTO dbo.U_EHARTINFML_JobHist
    from dbo.emphjob group by ejheeid order by max(ejhdatetimecreated) desc

  



      IF OBJECT_ID('U_EHARTINFML_AuditFields','U') IS NOT NULL
        DROP TABLE dbo.U_EHARTINFML_AuditFields;
    CREATE TABLE dbo.U_EHARTINFML_AuditFields (aTableName varchar(128),aFieldName varchar(128));
    
    -- Insert tables/fields to be audited
    INSERT INTO dbo.U_EHARTINFML_AuditFields VALUES ('EmpComp','eecEmplStatus');    
    
    -- Create audit table
    IF OBJECT_ID('U_EHARTINFML_Audit','U') IS NOT NULL
        DROP TABLE dbo.U_EHARTINFML_Audit;
    SELECT
         audTableName = adrTableName
        ,audFieldName = adfFieldName
        ,audKey1Value = ISNULL(adrKey1,'')
        ,audKey2Value = ISNULL(adrKey2,'')
        ,audKey3Value = ISNULL(adrKey3,'')
        ,audDateTime  = adrProcessedDateTime
        ,audOldValue  = adfOldData
        ,audNewValue  = adfNewData
        ,audRowNo     = ROW_NUMBER() OVER(PARTITION BY adrKey1, adrKey2, adrKey3, adfFieldName ORDER BY adrRecID DESC)
    INTO dbo.U_EHARTINFML_Audit
    FROM (SELECT *
          FROM dbo.AuditRecords WITH (NOLOCK)
          WHERE adrTableName IN (SELECT aTableName FROM dbo.U_EHARTINFML_AuditFields WITH (NOLOCK))) ADR
    JOIN (SELECT *
          FROM dbo.AuditFields WITH (NOLOCK)
          WHERE adfFieldName IN (SELECT aFieldName FROM dbo.U_EHARTINFML_AuditFields WITH (NOLOCK))) ADF
        ON adrSystemID = adfSystemID
       AND adrKey = adfKey
    WHERE adrType IN (1,2,5,6) -- Insert/Update; remove this to include Deletes and Viewed
      AND adrProcessedDateTime BETWEEN @StartDate AND @EndDate;
    
    -- Create Index
    CREATE CLUSTERED INDEX CDX_U_EHARTINFML_Audit ON dbo.U_EHARTINFML_Audit (audKey1Value, audKey2Value);

    --==========================================
    -- Build Driver Tables
    --==========================================
    ---------------------------------
    -- DETAIL RECORD - U_EHARTINFML_drvTbl
    ---------------------------------
    IF OBJECT_ID('U_EHARTINFML_drvTbl','U') IS NOT NULL
        DROP TABLE dbo.U_EHARTINFML_drvTbl;
    SELECT DISTINCT
         drvEEID = xEEID
        ,drvCoID = xCoID
        ,drvDepRecID = CONVERT(varchar(12),'1') --DELETE IF NOT USING DEPENDENT DATA
        ,drvSort = eepssn
        ,drvSubSort = CASE WHEN BdmRecType = 'EMP' THEN '1'
                                    WHEN BdmRecType = 'DEP' THEN '2'
                            END
        -- standard fields above and additional driver fields below
        ,drvCustomerNumber = '1481349'
        ,drvTransactionCode = CASE WHEN BdmRecType = 'EMP' THEN 'E'
                                    WHEN BdmRecType = 'DEP' THEN 'D'
                            END
        ,drvSSN = eepSSN
        ,drvEmployeeID = EecEmpNo
        ,drvDepSSN =  Conssn
        ,drvRelationshipCode = CASE WHEN bdmrectype  = 'DEP' and bdmrelationship IN ('CHL','STC','DCH','DPC') THEN 'CH'
                                    --WHEN bdmrectype  = 'DEP' and bdmrelationship = 'DP' THEN 'OT'
                                    WHEN bdmrectype  = 'DEP' and bdmrelationship IN ('DP','SPS') THEN 'SP'
                                    Else ''
                               END
        ,drvNameLast = CASE WHEN BdmRecType = 'EMP' THEN EepNameLast
                            WHEN BdmRecType = 'DEP' THEN ConNameLast
                       END
        ,drvNameFirst = CASE WHEN BdmRecType = 'EMP' THEN EepNameFirst
                            WHEN BdmRecType = 'DEP' THEN ConNameFirst
                       END
        ,drvNameMiddleInit = ''--LEFT(EepNameMiddle,1)
        ,drvDateOfBirth = case when bdmrectype = 'EMP' THEN EepDateOfBirth ELSE Condateofbirth END
        ,drvMaritalStatus = CASE WHEN EepMaritalStatus = 'Z' THEN 'U'
                                WHEN EepMaritalStatus = 'S' THEN 'I'
                                WHEN EepMaritalStatus = 'D' THEN 'D'
                                WHEN EepMaritalStatus = 'M' THEN 'M'
                                ELSE 'U'
                             END
        ,drvGender = CASE WHEN EepGender = 'Z' THEN 'U' ELSE EepGender END
        ,drvAddressLine1 = EepAddressLine1
        ,drvAddressLine2 = EepAddressLine2
        ,drvAddressCity = EepAddressCity
        ,drvAddressState = EepAddressState
        ,drvAddressZipCode = EepAddressZipCode
        ,drvHomePhone = ''--EepPhoneHomeNumber
        ,drvCellPhone = CASE WHEN EfoPhoneType = 'CEL' THEN EfoPhoneNumber END
        ,drvEmailPersonal = EepAddressEMailAlternate
        ,drvEmailWork = EepAddressEMail
        ,drvWorkStateCode = (Select Top 1 LocAddressState from Location where LocCode in (EEcLocation))--CASE WHEN EEcLocation = 'AUR' THEN 'CO' ELSE EEcLocation END
                            -- (Select Top 1 LocAddressState from Location where LocCode in (EEcLocation))
        ,drvPhoneNumbeBus = ''--EecPhoneBusinessNumber
        ,drvSupervisorNameLast = ''  
        ,drvSupervisorNameFirst = ''
        ,drvSupervisorID = ''--dbo.dsi_fnlib_GetSupervisorField('', B.EecSupervisorID, 'EmpNo') 
        ,drvSupervisorWorkPhone = ''--dbo.dsi_fnlib_GetSupervisorField_v2('', A.EecEEID, 'WorkPhone') 
        ,drvSupervisorEmail = ''--dbo.dsi_fnlib_GetSupervisorField_v2('', A.EecEEID, 'AddressEMail') 
        ,drvHRManagerLastName = ''--CASE WHEN EjhFLSACategory  in ('E','P') THEN Level2LastName ELSE Level3LastName END
