    INTO dbo.U_EHARTINFML_drvTbl
    FROM dbo.U_EHARTINFML_EEList WITH (NOLOCK)
    JOIN dbo.EmpComp B WITH (NOLOCK)
        ON EecEEID = xEEID 
        AND EecCoID = xCoID     
           and (eecemplstatus <> 'T' OR (eecemplstatus= 'T' and eectermreason <>'TRO' 
                                        and EXISTS(select 1 from dbo.U_EHARTINFML_Audit where  audKey1Value = xEEID AND audKey2Value = xcoid and audfieldname = 'eecemplstatus' and audNewValue = 'T')))   
    JOIN dbo.Company WITH (NOLOCK)
        ON CmpCoID = xCoID
    JOIN dbo.EmpPers WITH (NOLOCK)
        ON EepEEID = xEEID
    JOIN dbo.JobCode WITH (NOLOCK)
        ON JbcJobCode = EecJobCode
    LEFT JOIN (
                SELECT BdmEEID, BdmCOID, BdmRecType,BdmDepRecID,bdmrelationship
                

                ,VCI_DedCode = MAX(CASE WHEN BdmDedCode IN ('CI10E', 'CI10S', 'CI10C', 'CI10F', 'CI20E', 'CI20S', 'CI20C', 'CI20F') THEN BdmDedCode END)
                ,VCI_BdnStartDate = MAX(CASE WHEN BdmDedCode IN ('CI10E', 'CI10S', 'CI10C', 'CI10F', 'CI20E', 'CI20S', 'CI20C', 'CI20F') THEN BdmBenStartDate END)
                ,VCI_BdnStopDate = MAX(CASE WHEN BdmDedCode IN ('CI10E', 'CI10S', 'CI10C', 'CI10F', 'CI20E', 'CI20S', 'CI20C', 'CI20F')  THEN BdmBenStopDate END)
                 


        

                ,VCI_BenAMt = MAX(CASE WHEN BdmDedCode IN ('CI10E', 'CI10S', 'CI10C', 'CI10F', 'CI20E', 'CI20S', 'CI20C', 'CI20F') and bdmrectype = 'EMP' THEN LEFT(BdmUsgField1, LEN(BdmUSGField1) - 3)
                                       WHEN BdmDedCode IN ('CI10E', 'CI10S', 'CI10C', 'CI10F') and bdmrectype = 'DEP' THEN '10000' 
                                       WHEN BdmDedCode IN ('CI20E', 'CI20S', 'CI20C', 'CI20F') and bdmrectype = 'DEP' THEN '20000' 
                                       --WHEN BdmDedCode IN ('HARAC') and bdmrectype = 'DEP' and bdmrelationship = 'CHL' THEN '5000' 
                                     END)
                ,VCI_BenOpt = MAX(CASE WHEN BdmDedCode IN ('CI10E', 'CI10S', 'CI10C', 'CI10F', 'CI20E', 'CI20S', 'CI20C', 'CI20F')   THEN bdmbenoption END)

                ,VAC_DedCode = MAX(CASE WHEN BdmDedCode IN ('HARAC') THEN BdmDedCode END)
                ,VAC_BdnStartDate = MAX(CASE WHEN BdmDedCode IN ('HARAC') THEN BdmBenStartDate END)
                ,VAC_BdnStopDate = MAX(CASE WHEN BdmDedCode IN ('HARAC') THEN BdmBenStopDate END)
                ,VAC_BenAMt = MAX(CASE WHEN BdmDedCode IN ('HARAC') THEN bdmUsgField1 END)
                ,VAC_BenOpt = MAX(CASE WHEN BdmDedCode IN ('HARAC') THEN bdmbenoption END)

              

                FROM dbo.U_dsi_BDM_EHARTINFML WITH (NOLOCK)
                GROUP BY BdmEEID, BdmCOID,BdmRecType,BdmDepRecID,bdmrelationship) as ConsolidatedBDM
        ON BdmEEID = xEEID
        AND BdmCOID = xCOID
    LEFT JOIN dbo.EmpMPhon WITH (NOLOCK)
        ON EfoEEID = xEEID
    LEFT JOIN dbo.Contacts WITH (NOLOCK)
        on Consystemid =  bdmdeprecid
    Left Join dbo.U_EHARTINFML_JobHist  WITH (NOLOCK)
    on ejheeid = xeeid

    Delete from dbo.U_EHARTINFML_drvTbl where drvDateofBirth is null

    ;
    ---------------------------------
    -- HEADER RECORD
    ---------------------------------
    IF OBJECT_ID('U_EHARTINFML_Header','U') IS NOT NULL
        DROP TABLE dbo.U_EHARTINFML_Header;
    SELECT DISTINCT
         drvFileName =    CASE WHEN dbo.dsi_fnVariable(@FormatCode,'Testing') = 'Y' THEN 'test_INSPIRE_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.txt'
                            ELSE '210hbw_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.txt'
                        END
        ,drvDateFileCreated = Format(GetDate(), 'yyyyMMdd hh:mm:ss tt') -- CONVERT(VARCHAR, GETDATE(), 112) + ' ' + CONVERT(VARCHAR, GETDATE(), 8)
        ,drvCustomerName = 'INSPIRE'
        ,drvFileVersion = '2.0'
    INTO dbo.U_EHARTINFML_Header
    ;
    ---------------------------------
    -- TRAILER RECORD
    ---------------------------------
    IF OBJECT_ID('U_EHARTINFML_Trailer','U') IS NOT NULL
        DROP TABLE dbo.U_EHARTINFML_Trailer;
    SELECT DISTINCT
         drvRecordCount = FORMAT((SELECT COUNT(*) FROM dbo.U_EHARTINFML_drvTbl), '#0')
    INTO dbo.U_EHARTINFML_Trailer
    ;

    --==========================================
    -- Set FileName
    --==========================================
    IF (dbo.dsi_fnVariable(@FormatCode,'UseFileName') = 'N')
    BEGIN
        UPDATE dbo.U_dsi_Parameters
            SET ExportFile = CASE WHEN dbo.dsi_fnVariable(@FormatCode,'Testing') = 'Y' THEN 'Test_Filename_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.txt'
                                  WHEN @ExportCode LIKE 'OE%' THEN 'OE_Filename_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.txt'
                                  ELSE 'Filename_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.txt'
                             END
        WHERE FormatCode = @FormatCode;
    END

